/*Table structure for table `xx_article` */

DROP TABLE IF EXISTS `xx_article`;

CREATE TABLE `xx_article` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `author` varchar(255) DEFAULT NULL,
  `content` longtext,
  `generate_method` int(11) NOT NULL,
  `hits` bigint(20) NOT NULL,
  `is_publication` bit(1) NOT NULL,
  `is_top` bit(1) NOT NULL,
  `seo_description` varchar(255) DEFAULT NULL,
  `seo_keywords` varchar(255) DEFAULT NULL,
  `seo_title` varchar(255) DEFAULT NULL,
  `title` varchar(255) NOT NULL,
  `article_category` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ind_article_article_category` (`article_category`),
  CONSTRAINT `fk_article_article_category` FOREIGN KEY (`article_category`) REFERENCES `xx_article_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

/*Data for the table `xx_article` */

insert  into `xx_article`(`id`,`create_date`,`modify_date`,`version`,`author`,`content`,`generate_method`,`hits`,`is_publication`,`is_top`,`seo_description`,`seo_keywords`,`seo_title`,`title`,`article_category`) values (1,'2017-06-18 00:00:05','2017-06-18 00:00:05',0,NULL,'<p>随着电子商务的普及、移动端的大力发展，亚洲2015年将有望取代北美成为全球最大的电商市场。</p><p><br/></p><p>该报告预测，2015年亚洲零售市场预期平均增长4.6%，达到7.6万亿美元，远超欧洲(0.8%)及北美(2.5%)市场，稳居全球最大消费市场。值得注意的是，女性在整个亚洲消费市场中占有举足轻重的地位，网购更成为推动亚洲女性消费的新兴方式。</p><p><br/></p><p>在发布会现场，经济学人智库的资深分析师Laurel West表示：随着亚洲女性消费者经济地位的不断提升，亚洲女性正成为亚洲消费市场的主要驱动力。通过本次调研发现，亚洲女性在很大程度上主导了家庭消费决策，不仅在服饰、化妆品、日用品等类别，还包括电子产品、家具、旅行等高单价商品类别。</p><p><br/></p><p>值得一提的是，相比线下购物，近一半的女性更青睐网购(中国大陆为69%)；63%的女性每天至少上网浏览商品与服务一次，近30%的人每天浏览两次或更多。女性更愿意为自己购物，此外，部分女性在感到为自己购买过多时，出于“内疚”心理，会为丈夫、子女及父母等家庭成员买些东西作为补偿。女性消费者网购最关注的是：品牌优品、优惠价格和正品商品；女性购买最多的品类是：服饰、母婴和美妆。</p><p><br/></p><p>另外，调查发现移动端购物已成为主流趋势之一，在年轻的亚洲女性消费群体中尤为明显。调查显示，18至29岁年龄段的女性热衷网购的比例高达一半，且在这一年龄段中超过一半的女性习惯在家用智能手机网购。而 “冲动消费”的特征在这一年龄段的亚洲女性身上也更为突出，半数以上的18至29岁女性承认更容易冲动购物，而在稍大年龄段的女性中则为40%。</p><p><br/></p><p>这份名为《崛起中的亚洲女性网购力量》调查报告，汇集了两岸三地、印度、日本、新加坡以及韩国5500名女性网购数据。</p>',0,0,'','\0',NULL,NULL,NULL,'亚洲将有望成为全球最大电商市场',1),(2,'2017-06-18 00:00:06','2017-06-18 00:00:06',0,NULL,'<p>近日，普华永道最新发布的《2015年中国金融及银行业展望》调研。大部份受访者认为不良贷款风险仍在可控范围。此外， 本次调研除了国内银行及外资银行，还包括互联网P2P借贷平台、互联网理财机构等等。虽然新参与者直接挑战了传统金融机构，但受访者认为将来两者之间合作 胜于竞争。调研预期，对于互联网金融更严格监管将在2015年得到落实。参与调研的受访者认为，商业银行的净息差将被进一步压缩至约2%，这个水平与大部份发达国家市场相似。受访者认为，中国银行业必须减少对存贷业务的依赖。调研显示，越来越多的传统金融机构也进行互联网探索，比如一些信托公司觊觎互联网产品销售平台，以求降低成本。分析认为，互联网理财产品除了拥有高收益外， 还有传统货币及银行理财产品无法比拟的流动性优势。但随着央行向商业提供流动性，银行同业拆借利率有所回落，上述产品的收益率优势在缩小。此外，传统商业银行的中间业务收入也受到了互联网第三方支付平台的挑战，比如支付宝及财付通等。调研认为，第三方支付平台的出现，导致商业银行从传统银行卡业务中能收取的费用越来越少。预计2015年，线上支付会突破10万亿人民币，移动支付会突破4万亿人民币。</p>',0,0,'','\0',NULL,NULL,NULL,'2015年我国移动支付或突破4万亿元',1),(3,'2017-06-18 00:00:07','2017-06-18 00:00:07',0,NULL,'<p>2014年是移动电商大爆发的一年。微信和手机QQ购物、微店、天猫和京东移动端交易、网上支付、电商+虚拟运营商等成为2014年移动电商的关键词。各大电商如阿里、京东、苏宁、唯品会等也在向移动电商倾斜。同时，中国互联网协会秘书长卢卫表示，2014年我国互联网领域迎来新一轮融资高峰，新兴O2O商务应用服务在国内全面布局，涉及招聘、电影票、交通票务、旅游门票、打车代驾租车、餐饮、美容、汽车保养等领域的移动互联网热点不断涌现，服务民生的智能应有体系逐步成熟，市场规模加速扩大。截至2014年第三季度，我国移动网购交易规模已超2100亿元，比2013年增长了近3倍。据中国电子商务研究中心监测数据显示，2014年中国移动购物的交易规模接近10万亿元，增长率达到270%。</p>',0,0,'','\0',NULL,NULL,NULL,'2015年我国移动电商交易规模或将超千亿',1),(4,'2017-06-18 00:00:08','2017-06-18 00:00:08',0,NULL,'<p>从2014年看，B2C市场中，天猫市场份额占比超六成，京东占比为18.6%，其余B2C企业中唯品会、1号店、国美的增速均高于B2C市场整体增速。从自主销售为主B2C市场来看，京东占比近五成，苏宁易购占比达到8.5%，唯品会占比达到7.7%，其他项中小米手机官网发展迅速，整个市场集中度依然较高。</p><p><br/></p><p>艾瑞分析认为，阿里及京东等综合性电商在进行多元化发展的同时，其他电商企业也纷纷在行业内寻找自己的生存空间，从供应链整合、产品拓展、品牌打造、服务优化等各方面持续发力，提升企业的核心竞争优势，网络购物行业竞争格局将持续演进。</p><p><br/></p><p>未来趋势：渠道下沉、行业渗透范围扩大及跨境电商将成为行业未来发展趋势</p><p><br/></p><p>渠道下沉：三四线城市及乡镇地区的居民收入水平的不断提高，购物需求日益旺盛，在一二线城市网购渗透率逐渐饱和的情况下，需求旺盛的农村市场开始成为各电商企业发力的新重点，近两年来大量电商企业通过刷墙、建立服务点等方式进入农村，物流公司也开始覆盖乡镇等配送范围，未来几年，电商将持续向三四线城市及乡镇地区渗透。</p><p><br/></p><p>加速向各行业渗透：随着电子商务进程的加深及网络销售商品品类的不断扩充，除了电商行业内先发品类如服装、3C家电、化妆品等线上渗透率不断提升外，偏服务及体验的产品如商旅、保险、基金等产品的线上发展水平也在不断提升，此外，重服务的家装电商、医药电商等也开始快速发展。</p><p><br/></p><p>跨境电商快速发展：从政策层面看，国家出台了一系列跨境电商促进政策并先后批准上海、宁波、郑州等市开展跨境电商试点，为跨境电商提供政策支持。从市场需求看，除了国外消费者对中国国内物美价廉商品的巨大需求外，随着社会消费水平的提高中国消费者对海外优质的品牌商品也有同样旺盛的购买需求。从企业来看，除了既有行业内的大量外贸电商企业外，内贸电商企业也纷纷实施国际化战略，布局跨境电商业务。未来几年，在行业前景明朗、政策利好及市场需求旺盛的共同推动下，未来跨境电商行业将会获得快速发展。</p>',0,0,'','\0',NULL,NULL,NULL,'2014我国网络购物交易规模2.8万亿 增48%',1),(5,'2017-06-18 00:00:09','2017-06-18 00:00:09',0,NULL,'<p>据新华社电奢侈品研究和顾问机构财富品质研究院昨天发布的《中国奢侈品报告》表明，中国消费者奢侈品消费76％在境外。</p><p><br/></p><p>财富品质研究院调研显示，中国消费者2014年在本土消费额明显下降，为250亿美元，同比下降11％，中国奢侈品市场占全球奢侈品市场比重由2013年的13％下降到2014年的11％。虽然奥特莱斯和网络销售都有明显增长，但都没有改变2014年中国奢侈品市场整体下滑态势；中国消费者境外消费进一步加强，2014年境外消费达810亿美元，同比增长超过9％。</p><p><br/></p><p>“这说明2014年中国消费者76％的奢侈品消费发生在境外，中国消费者奢侈品消费外流已经到了非常严重的地步。”财富品质研究院院长周婷说。</p><p><br/></p><p>虽然全球奢侈品市场2014年依然面临诸多压力，但是全球奢侈品市场总容量仍达到创纪录的2320亿美元，预计全年增长率达到7％。其增长主要来源于高端小众品牌，特别是定制类品牌的快速发展，而传统奢侈品牌的相对市场份额明显下降。</p><p><br/></p><p>据统计，中国消费者全球奢侈品消费达到1060亿美元，同比增长4％，这表明中国人2014年买走了全球46％的奢侈品，虽然占比略有下降，但中国消费者仍是全球奢侈品市场无可争议的最大买家。</p>',0,0,'','\0',NULL,NULL,NULL,'中国消费者奢侈品消费76％在境外',1),(6,'2017-06-18 00:00:10','2017-06-18 00:00:10',0,NULL,'<p>据媒体报道，中国互联网信息中心表示，截至去年底，中国网民达6.48亿。该数字较2013年增加3000万。</p><p><br/></p><p>中国有关网民的定义为半年内至少使用过一次互联网的人。中国的网民数量已超过世界上任何其他国家。中国还拥有庞大电商市场，互联网正被中国公民用以曝光官员滥权行为并已引发中共关注。</p>',0,0,'','\0',NULL,NULL,NULL,'中国网民接近6.5亿 较2013年增加3000万',1),(7,'2017-06-18 00:00:11','2017-06-18 00:00:11',0,NULL,'<p>我国跨境电商的发展速度惊人。昨日中国海关总署表示，从2013年7月启动以来，截至去年底，中国跨境电子商务试点已突破30亿元人民币，其中约1/3为进口业务。</p><p><br/></p><p>在出口方面，截至2014年12月底，上海、重庆、杭州等16个城市先后开展出口业务，累计验放清单3823.5万份，出口到181个国家和地区，价值约20.4亿元。在进口方面，截至2014年12月底，上海、重庆、杭州、宁波、郑州、广州、深圳先后开展了进口业务，共验放包裹411万余件，价值约10.1亿元。</p><p><br/></p><p>海关总署新闻发言人张广志表示，为避免地方重复建设，海关总署2014年开发了适用于全国的统一版跨境电子商务出口通关管理系统，并于当年7月1日在东莞率先上线运行。该系统依托电子口岸平台，实现与电商、物流、支付企业和平台的高效对接，全程掌握跨境电子商务的准确数据和状态。目前，大龙网、亿赞普、傲基等50余家企业已经完成与中国电子口岸数据中心的联网对接，并实现数据交换。</p>',0,0,'','\0',NULL,NULL,NULL,'2014年全年我国跨境电商试点突破30亿元',1),(8,'2017-06-18 00:00:12','2017-06-18 00:00:12',0,NULL,'<p>2014年可穿戴设备成为消费者的新宠，预示着另一种先进的电子消费品正在普及中：技术正在成为我们身体的一部分。根据eMarketer新报告“Wearables:10 Insights on Device Adoption and Business Opportunities.”，利用这些可穿戴设备的品牌也将成为我们身体的一部分。</p><p><br/></p><p>可穿戴设备</p><p><br/></p><p>今年可穿戴设备的出货量增长率将达到3位数，International Data Corporation预测2014年全球可穿戴设备出货量将达到192亿单位，增长超过200%。可穿戴设备受追捧主要有两个原因。首先，快速增长在新技术类别并不稀奇，尤其是一个大类别。身体的每个主要部位都有对应的可穿戴设备。其次，这种神奇的商品吸引了大量的消费者，但还未进入市场。Apple Watch将会在2015年初推出。但是，各个种类的可穿戴设备在美国消费者中的普及率都比较低。</p><p><br/></p><p>但是，忽视可穿戴设备是个失误。早期使用这些设备很有吸引力，这标志着美国市场已经准备好迎接下一个技术革新。而且，前瞻性企业已经开始采取行动，屏幕出现在更多可穿戴设备上，展示技术正在改进。但是，消费者使用可穿戴设备跟多的是因为其可以穿戴、跟踪和通知，这使得营销商将注意力集中在可穿戴上而不是互动上。</p><p><br/></p><p>全球移动广告网络运营商InMobi副总裁Atul Satija表示“可穿戴设备的互动不会是通过两个大拇指的方式，而是通过单个手指选择‘是’或‘否’来进行的。”</p><p><br/></p><p>例如，许多营销商相信用智能手表接收信息会促进互动。由于接触互动的受限，Satija和其他人都认为声音将会是更友好、更有效的互动方式。</p><p><br/></p><p>房地产搜索网站Trulia的CEO Kira Wampler表示，发送到可穿戴设备的信息的目的应该是“给用户选择是否采取下一步行动的信息”，更复杂的交流是不可能的。</p>',0,0,'','\0',NULL,NULL,NULL,'2014全球可穿戴设备出货量将增超200%',1),(9,'2017-06-18 00:00:13','2017-06-18 00:00:13',0,NULL,'<p>狂欢节活动</p>',0,0,'','\0',NULL,NULL,NULL,'狂欢节活动',2),(10,'2017-06-18 00:00:14','2017-06-18 00:00:14',0,NULL,'<p>手机全场低至9.5折</p>',0,0,'','\0',NULL,NULL,NULL,'手机全场低至9.5折',2),(11,'2017-06-18 00:00:15','2017-06-18 00:00:15',0,NULL,'<p>劲爆限时抢购</p>',0,0,'','\0',NULL,NULL,NULL,'劲爆限时抢购',2),(12,'2017-06-18 00:00:16','2017-06-18 00:00:16',0,NULL,'<p>家电狂降五折起</p>',0,0,'','\0',NULL,NULL,NULL,'家电狂降五折起',2),(13,'2017-06-18 00:00:17','2017-06-18 00:00:17',0,NULL,'<p>年终排行榜盛惠</p>',0,0,'','\0',NULL,NULL,NULL,'年终排行榜盛惠',2),(14,'2017-06-18 00:00:18','2017-06-18 00:00:18',0,NULL,'<p>将限量”温情”带回家</p>',0,0,'','\0',NULL,NULL,NULL,'将限量”温情”带回家',2);

/*Table structure for table `xx_article_category` */

DROP TABLE IF EXISTS `xx_article_category`;

CREATE TABLE `xx_article_category` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `orders` int(11) DEFAULT NULL,
  `grade` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `seo_description` varchar(255) DEFAULT NULL,
  `seo_keywords` varchar(255) DEFAULT NULL,
  `seo_title` varchar(255) DEFAULT NULL,
  `tree_path` varchar(255) NOT NULL,
  `parent` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `ind_article_category_parent` (`parent`),
  CONSTRAINT `fk_article_category_parent` FOREIGN KEY (`parent`) REFERENCES `xx_article_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

