insert  into `xx_brand`(`id`,`create_date`,`modify_date`,`version`,`orders`,`introduction`,`logo`,`name`,`type`,`url`) values (1,'2017-06-18 00:02:46','2017-06-18 00:02:46',0,1,'<p>华鑫集团成立于1998年，现有总资产60亿元，旗下拥有采煤、洗选、焦炭、化产、化肥、热电、贸易、房地产、旅游等相关产业，是一家集生产、经营、文化、生态建设为一体的循环型、现代化、规模化企业集团。华鑫集团集团发扬艰苦创业、勇于创新的精神，坚持科学经营、规范管理的理念，经过数年发展迅速跻身于全省重点企业行列，是中国炼焦行业五十强企业，山西省循环经济企业，山西省炼焦行业十强企业。</p>','http://localhost:8080/yngs/upload/image/201611/202f97be-eece-4504-b68b-7d19e527e7ca.gif','山西华鑫',1,'http://www.sxhuaxin.cn'),(2,'2017-06-18 00:02:47','2017-06-18 00:02:47',0,2,'<p class=\"p0\"><span style=\"line-height:1.5;font-size:14px;\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"line-height: 1.5; font-size: 16px;\">&nbsp; 山东米高生物科技有限公司由苏州东洋化肥有限公司与高密市高农生产资料连锁有限公司公司合资设立，公司位于高密大牟家工业园。</span></span></p><p class=\"p0\"><span style=\"font-size: 16px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 高密有良好的区位优势和便利的交通条件。东临旅游名城青岛，西依世界风筝古都潍坊。境内胶济铁路、胶新铁路、济青高速公司、省道潍胶公路、平日公路、胶王公路纵横贯穿，高等级公路四通八达，连接济南、青岛、潍坊、烟台、日照等开放城市和港口城市，距青岛、潍坊机场不足70公里，厂区周围四面环路，与外界联系十分方便。</span></p><p><br/></p>','http://localhost:8080/yngs/upload/image/201611/97ee1baf-0262-42f9-b748-9255c4ca4997.gif','米高生物',1,'http://www.sdmigo.com'),(3,'2017-06-18 00:02:48','2017-06-18 00:02:48',0,3,'<p>江苏恒康肥业有限公司是县质监局招商引资项目，由南京云台集团投资4100万元兴建，占地面积30亩，总建筑面积1.1万平方米，计划用工200余人，生产工艺采用目前国内最先进的氨酸造粒技术，年可生产氨酸复合肥10万吨.江苏恒康肥也有限公司是一家经国家相关部门批准注册的企业。江苏恒康肥也有限公司凭着良好的信用、优良的服务与多家企业建立了长期的合作关系。江苏恒康肥也有限公司热诚欢迎各界朋友前来参观、考察、洽谈业务。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>','http://localhost:8080/yngs/upload/image/201611/a2726d33-61e0-4bce-b8dc-60e7c0068f5d.gif','恒康肥业',1,'http://www.sony.com.cn'),(4,'2017-06-18 00:02:49','2017-06-18 00:02:49',0,4,'<p>江苏华昌（集团）有限公司已有39年历史，是一家以化工为主体的国家大型二类企业，中国化工百强，张家港市十大重点骨干企业之一。集团公司现有15家生产、经营企业（公司），其中1家国家级高新技术企业，6家省级高新技术企业，1家上市公司，经营范围涉及化工、机电、建筑和宾馆服务等。所有生产企业均通过ISO2000版质量体系和ISO14001、ISO18001环境、安全体系认证，出口产品达30种。\r\n 集团现有总固定资产约30亿元，总员工超5000人。2008年实现销售收入超50亿元，外贸出口额约10亿元，自营出口额约1亿美元。<br/></p>','http://localhost:8080/yngs/upload/image/201611/c38febfa-9bd8-4534-a680-91421661fd02.gif','江苏华昌',1,'http://www.huachangchem.cn'),(5,'2017-06-18 00:02:50','2017-06-18 00:02:50',0,5,'<p>河南晋开化工投资控股集团有限责任公司（简称“晋开集团”）的前身是开封晋开化工有限责任公司，成立于2004年5月28日，是中国500强企业山西晋煤集团在山西省境外设立的第一家煤化工子公司。2008年5月28日，以开封晋开化工有限责任公司为母公司组建河南晋开投资控股集团，公司变更为现名。s</p><p><br/></p>','http://localhost:8080/yngs/upload/image/201611/b53fa37b-47e9-45d9-afcd-64b9cfe1145a.gif','河南晋开',1,'http://www.jinkaihg.com'),(6,'2017-06-18 00:02:51','2017-06-18 00:02:51',0,6,'<p>瓮福（集团）有限责任公司是集磷矿采选、磷复肥、磷煤化工、氟碘化工生产、科研、贸易和国际工程总承包为一体的国有大型磷化工企业。</p>','http://localhost:8080/yngs/upload/image/201611/255ac3d2-119a-45a3-9590-0a1a34e1da83.gif','瓮福集团',1,'http://wfnz.wengfu.com'),(7,'2017-06-18 00:02:52','2017-06-18 00:02:52',0,7,'<p>兴发集团位于湖北省<a target=\"_blank\" href=\"http://baike.baidu.com/view/79527.htm\">宜昌市</a><a target=\"_blank\" href=\"http://baike.baidu.com/view/119152.htm\">兴山县</a>，是一家依托<a target=\"_blank\" href=\"http://baike.baidu.com/view/5211.htm\">宜昌</a>及周边地区丰富的水电和磷矿资源发展起来的“化工为主导，电矿为基础，科工贸结合”的大型精细磷化工企业。现控股一家上市公司，总资产50亿元，员工约4500人。是目前世界上最大的六偏磷酸钠和中国最大的三聚磷酸钠生产企业。</p>','http://localhost:8080/yngs/upload/image/201611/423b0458-7ecf-4e84-a792-17db93cd5ae4.gif','兴发集团',1,'http://www.xingfagroup.com'),(8,'2017-06-18 00:02:53','2017-06-18 00:02:53',0,8,'<p>广东友宁贸易有限公司简介广东友宁贸易有限公司成立于1995年，主要经营医用和研究用的医疗器械、试剂和消耗品，在辅助生殖、分子遗传和男性学方面建立了遍布全国的销售网络和一批专业的售后服务队伍。近十年来，公司与国内外的辅助生殖中心、遗传研究所及世界著名的相关生产厂家保持着长期紧密的技术交流和业务来往，并以至诚、忠恳的服务宗旨及优惠的产品价格为客户所称赞。公司的主要客户有：中山大学附属第一医院、中山大学附属第二医院、中山大学附属第三医院、中山大学附属肿瘤医院、广东省人民医院血液、南方医院、南方医院、浙江大学附属妇产科医院、温州医学院附属第一医院、上海瑞金医院、云南省第一人民医院、广西壮族自治区妇幼保健院、广西壮族自治区人民医院等等。二、\r\n	\r\n广东友宁贸易有限公司组织结构广东友宁贸易有限公司下设销售部、技术服务部、物流部和财务部。总经理蓝俊先生1984年毕业于华南理工大学计算机专业，曾服务于国际著名的公司BIO-RAD，任专业工程师。</p>','http://localhost:8080/yngs/upload/image/201611/0ee0a656-f6e9-410d-b267-198c3d14728d.gif','友宁',1,'http://www.panasonic.cn'),(9,'2017-06-18 00:02:54','2017-06-18 00:02:54',0,9,'<p>北京颖泰嘉和科技股份有限公司是一家以市场为先导、研发为动力、生产为支撑,以创新为方向的中型高科技企业。公司主要从事农用化学品、医药及其中间体、其他精细化工品。</p>','http://localhost:8080/yngs/upload/image/201611/7c1f107a-3d5b-4081-8032-71e8c9922571.png','Nutrichem',1,'http://www.nutrichem.cn'),(10,'2017-06-18 00:02:55','2017-06-18 00:02:55',0,10,'<p>江苏扬农化工集团有限公司是生产农药、氯碱、精细化工产品的企业。其控股的江苏扬农化工股份有限公司是国内规模最大的新型仿生农药--拟除虫菊酯生产基地，已于2002年4月成功上市。在苯的硝化氯化产品、环氧氯丙烷、农用和卫生用菊酯等产业具有领先的市场地位和全球影响力，年盈利规模超3.5亿元人民币，现有三个配套齐全的精细化工产业基地。</p>','http://localhost:8080/yngs/upload/image/201611/6ab66c21-7f0d-4a09-a187-5f0c907c8fae.gif','江苏扬农',1,'http://www.yangnong.com.cn'),(11,'2017-06-18 00:02:56','2017-06-18 00:02:56',0,11,'<p><span class=\"pp_1\">“溉朴”是深圳市金</span><span class=\"pp_1\">佰诺投资担保有限公司投资倾力打造的系列农业产业商标之一。“溉朴”品牌水溶肥是该产业的龙头产品，由深圳溉朴农业科技有限公司高端运营的中国水溶肥冠军品牌，专注于提供水肥一体化解决方案、作物营养解决方案。</span></p>','http://localhost:8080/yngs/upload/image/201611/d273ad2f-d335-4fe4-9b98-77882b9e49a3.jpg','溉朴',1,'http://www.sinogap.com'),(12,'2017-06-18 00:02:57','2017-06-18 00:02:57',0,12,'<p><span style=\"font-size: 12px; font-family: 宋体,tahoma,arial,sans-serif; line-height: 150%;\">公司为国有控股企业，成立于2004年底，注册资本12718.98万元。公司前身核工业华新生物化学制品厂始建于1989年，是江西省第一家赤霉酸生产定点企业......</span><span style=\"font-size: 16px;\"></span></p>','http://localhost:8080/yngs/upload/image/201611/288405ba-5554-46cc-82bb-da9037471a64.png','NEW REYPHON',1,'http://www.jxxrf.com'),(13,'2017-06-18 00:02:58','2017-06-18 00:02:58',0,13,'<p><strong>青岛海鲸灵海藻集团 &nbsp; 青岛鲸灵海洋科技有限公司 &nbsp;</strong><strong>青岛海鲸灵农资连锁有限公司 &nbsp; </strong><strong>青岛海鲸灵农业机械有限公司 &nbsp; 筹建青岛海鲸灵海鸥斯曼作物营养技术有限公司 &nbsp;</strong><strong>青岛巨浪海藻生物技术有限公司</strong></p>','http://localhost:8080/yngs/upload/image/201611/5f35d7a0-4de1-4dbd-9b21-d2075c5802b9.png','青岛海鲸灵',1,'http://www.jlfert.com'),(14,'2017-06-18 00:03:02','2017-06-18 00:03:02',0,14,'<p><em>江西沪航</em>实业有限公司坐落于国家级技术开发区---江西省南昌市经济技术开发区。公司距离赣江水运码头仅1.5公里之遥,通过赣江及长江流域。</p>','http://localhost:8080/yngs/upload/image/201612/33323a88-107f-4b73-a9f1-7384c0844569.jpg','江西沪航',1,'http://www.jxhuhang.com');

/*Table structure for table `xx_cart` */

DROP TABLE IF EXISTS `xx_cart`;

CREATE TABLE `xx_cart` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `expire` datetime NOT NULL,
  `cart_key` varchar(255) NOT NULL,
  `member` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uni_cart_cart_key` (`cart_key`),
  KEY `ind_cart_member` (`member`),
  CONSTRAINT `fk_cart_member` FOREIGN KEY (`member`) REFERENCES `xx_member` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

