/*Table structure for table `xx_cart_item` */

DROP TABLE IF EXISTS `xx_cart_item`;

CREATE TABLE `xx_cart_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `quantity` int(11) NOT NULL,
  `cart` bigint(20) NOT NULL,
  `product` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ind_cart_item_cart` (`cart`),
  KEY `ind_cart_item_product` (`product`),
  CONSTRAINT `fk_cart_item_cart` FOREIGN KEY (`cart`) REFERENCES `xx_cart` (`id`),
  CONSTRAINT `fk_cart_item_product` FOREIGN KEY (`product`) REFERENCES `xx_product` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

