  CONSTRAINT `fk_consultation_goods` FOREIGN KEY (`goods`) REFERENCES `xx_goods` (`id`),
  CONSTRAINT `fk_consultation_member` FOREIGN KEY (`member`) REFERENCES `xx_member` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

