/*Table structure for table `xx_product_category_brand` */

DROP TABLE IF EXISTS `xx_product_category_brand`;

CREATE TABLE `xx_product_category_brand` (
  `product_categories` bigint(20) NOT NULL,
  `brands` bigint(20) NOT NULL,
  PRIMARY KEY (`product_categories`,`brands`),
  KEY `ind_product_category_brand_b` (`brands`),
  CONSTRAINT `fk_product_category_brand_b` FOREIGN KEY (`brands`) REFERENCES `xx_brand` (`id`),
  CONSTRAINT `fk_product_category_brand_p_c` FOREIGN KEY (`product_categories`) REFERENCES `xx_product_category` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `xx_product_category_brand` */

/*Table structure for table `xx_product_category_promotion` */

DROP TABLE IF EXISTS `xx_product_category_promotion`;

CREATE TABLE `xx_product_category_promotion` (
  `product_categories` bigint(20) NOT NULL,
  `promotions` bigint(20) NOT NULL,
  PRIMARY KEY (`product_categories`,`promotions`),
  KEY `ind_product_category_p_p` (`promotions`),
  CONSTRAINT `fk_product_category_p_p` FOREIGN KEY (`promotions`) REFERENCES `xx_promotion` (`id`),
  CONSTRAINT `fk_product_category_p_p_c` FOREIGN KEY (`product_categories`) REFERENCES `xx_product_category` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `xx_product_category_promotion` */

/*Table structure for table `xx_product_notify` */

DROP TABLE IF EXISTS `xx_product_notify`;

CREATE TABLE `xx_product_notify` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `email` varchar(255) NOT NULL,
  `has_sent` bit(1) NOT NULL,
  `member` bigint(20) DEFAULT NULL,
  `product` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `ind_product_notify_member` (`member`),
  KEY `ind_product_notify_product` (`product`),
  CONSTRAINT `fk_product_notify_member` FOREIGN KEY (`member`) REFERENCES `xx_member` (`id`),
  CONSTRAINT `fk_product_notify_product` FOREIGN KEY (`product`) REFERENCES `xx_product` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `xx_product_notify` */

/*Table structure for table `xx_promotion` */

DROP TABLE IF EXISTS `xx_promotion`;

CREATE TABLE `xx_promotion` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `orders` int(11) DEFAULT NULL,
  `begin_date` datetime DEFAULT NULL,
  `end_date` datetime DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `introduction` longtext,
  `is_coupon_allowed` bit(1) NOT NULL,
  `is_free_shipping` bit(1) NOT NULL,
  `maximum_price` decimal(21,6) DEFAULT NULL,
  `maximum_quantity` int(11) DEFAULT NULL,
  `minimum_price` decimal(21,6) DEFAULT NULL,
  `minimum_quantity` int(11) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `point_expression` varchar(255) DEFAULT NULL,
  `price_expression` varchar(255) DEFAULT NULL,
  `title` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
